import React from 'react';
import ReactDOM from 'react-dom';

import './index.css'
import 'bootstrap/dist/css/bootstrap.css';
import Body from './components/Body';

function App() {
  return (
    <div className='fullContainer container'>
    <Body />
    </div>
  );
}

ReactDOM.render(
    <App/>,
    document.getElementById('App')
)
